const {
  AccountCircle,
  HomeRounded,
  PhoneAndroidRounded,
} = require("@material-ui/icons");
const { default: InputCustomize } = require("./components/InputCustomize");

export const structure = [
  {
    section: "Infomation",
    fields: [
      {
        grid: 6,
        component: () => (
          <InputCustomize
            title="First Name"
            icon={() => <AccountCircle color="primary" />}
          />
        ),
      },
      {
        grid: 6,
        component: () => (
          <InputCustomize
            title="Last Name"
            icon={() => <AccountCircle color="primary" />}
          />
        ),
      },
      {
        grid: 6,
        component: () => (
          <InputCustomize
            title="Age"
            icon={() => <AccountCircle color="primary" />}
          />
        ),
      },
    ],
  },
  {
    section: "Contact",
    fields: [
      {
        component: () => (
          <InputCustomize
            title="Address"
            icon={() => <HomeRounded color="primary" />}
          />
        ),
      },
      {
        component: () => (
          <InputCustomize
            title="Email"
            icon={() => <AccountCircle color="primary" />}
          />
        ),
      },
      {
        component: () => (
          <InputCustomize
            title="Phone"
            icon={() => <PhoneAndroidRounded color="primary" />}
          />
        ),
      },
    ],
  },
  //   {
  //     section: "Social Media",
  //   },
  //   {
  //     section: "Infomation",
  //   },
];
